  `pPrivilege` tinyint(4) NOT NULL DEFAULT '0',
  `pFace` blob,
  `pIcon` blob,
  `pTel` char(16) DEFAULT NULL,
  PRIMARY KEY (`pId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

